import React from 'react';
import './background.css';
import wood_background from '../../Assets/wood_background.webp'



const Background = () => (
    <div className="background_container">
        <div class="example">
            <img class="background-image"
                src={wood_background} />
            <div class="overlay">
                Multi-line <br />text
            </div>
        </div>
    </div>
);
export default Background;
